  \"Development of a Novel Non-Equilibrium Pulsed Plasma Ignition Module for High
  Altitude Turbojets Project\",\n\t\"tracking_summary\": {\n\t\t\"total\": 1,\n\t\t\"recent\":
  1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\":
  \"2015-05-07T06:03:55.870424\",\n\t\"name\": \"development-of-a-novel-non-equilibrium-pulsed-plasma-ignition-module-for-high-altitude-tur\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"An experimental research program focusing
  on design, development, and testing of a novel nonequilibrium plasma ignition module
  is proposed. The ignition module will be based on the use of diffuse high-pressure
  transverse discharge technology recently developed at Ohio State using Air Force
  support. The proposed research is of critical importance for development of nonequilibrium
  plasma igniters modules for airplane jet engines. The primary objectives of the
  proposed research are (i) extending the use of the new nonequilibrium plasma ignition
  / flameholding method demonstrated in previous research by the current proposers
  to higher static pressures (up to P=0.5-1.0 atm), (ii) measuring the NOx emissions
  in the pulsed plasma stabilized flames and the plasma power budget, and (iii) studying
  the effect of the pulsed plasma on flame blow-off and relight. The proposed research
  will be conducted using gaseous hydrocarbon fuels. The results would have direct
  impact on development and the use of nonequilibrium plasma ignition modules for
  lean combustor operation and high altitude turbojet relight. The results would also
  elucidate kinetic mechanisms of plasma assisted ignition and flameholding.\",\n\t\"license_title\":
